    "dateTime": "2016-05-21T11:00+03:00",
    "eventUrl": "https://www.meetup.com/tim-js/events/230179755",
    "description": "For all of you who didn't get a seat in the first workshop, there's a second chance in this second edition.\n\nThis first workshop dives into the building blocks of the ECMAScript language, explaining in detail each of its 1st class citizens, how they work & why is it so important to understand them.\n\nIn the last part of the workshop, we will implement a small design pattern that every developer uses daily.\n\nCONTENT\n\n- Intro: short history, JS vs ES;\n- Primitives: types, typeof, type casting, falsey values;\n- Arrays: literals, stack, queue, filtering, iterating;\n- Objects: literals, enhanced literals, property descriptors, json;\n- Functions: types, returns, 1st class functions.\n\nWHO IS IT FOR?\n\n• Beginner & Intermediate JavaScript developers who want to discover the language at a deeper level.\n\n• Advanced developers, who switched to JavaScript recently and want to understand its mechanics.\n\nWHAT YOU NEED?\n\n- laptop with power-plug\n- code editor (optional)- Node.JS 4.0 or greater installed (optional)\n\nHOW TO ATTEND?\n\nTo attend this workshop, please RSVP this event.\nThere are only 18 seats available that will be filled on a first-come, first-served basis.\n\nA deposit of 40 RON (9 EUR) is required, which will cover all expenses, including lunch (vegetarian is also available) & beverages (coffee, juice, water).",
