    "shortDescription": "**State of AI in JS [2019 Edition]**.\nType: Presentation + Open Discussion.\nVictor Adăscăliței and Radu Milici are going to walk US through the current state of AI and explore what’s possible with this technology in the world of JS.",
    "description": "Hey hey!\nRegardless of what the weather will be like next week (it's one week autumn, the other hot summer), we're inviting you to a new (round) edition of tim.js.\n\nTeaser: State of AI in JS [2019 Edition].\nType: Presentation + Open Discussion.\n\nVictor Adăscăliței and Radu Milici are going to walk US through the current state of AI and explore what’s possible with this technology in the world of JS.\n\nSee you there!",
