    "description": "Hello again Timisoara JavaScript-ers,\n\nThis is the last regular meetup of the year, so we're kicking it hard with a diverse and engaging ⚡️**Lightning Talks**⚡️ session, max. 10 minutes / talk:\n\n\\-\\-\\-\n\n**📋 Agenda**\n\n**React Server Components - The Next Step**\nCiprian Caba -- VP of Engineering @ 7879\n\n**Staying safe from Authorization Managers**\nLucian Pacurar -- Tech Lead @ Visma\n\n**Storybook x Figma**\nVictor Vranceanu -- Software Engineer @ WeVideo\n\n**Internal vs. external interface names**\nAndrei Pfeiffer -- Code Designer @ Smilecloud\n\n**Live editing subtitles with WebVTT**\nAnca Spatariu -- Software Engineer @ WeVideo\n\n**Intro to Intersection Observer API**\nFlavius Badescu -- Frontend Developer @ ExWeVideo\n\n\\-\\-\\-\n\nSend us your proposals at **contact@timjs.ro**.",
