    "description": "Tis the season to be social! 🎄\n\nThis December, like every\\* year, we're gathering in a non-formal setting to have a chat, share some thoughts and wrap up 2022.\n\nOur host this year will be **WeVideo**, so we're waiting for you **Wednesday, Dec 21** on **12 Popa Sapca street** (the CBS building at the end of the alley) starting with **18:00**.\n\n___\n\\*except those when we have global pandemics, of course",
