    "description": "This month we're taking a break from our regular technical talks to enjoy a casual social gathering at Reciproc Café. Besides the heated JavaScript discussions cooled by your favourite drink we're going to have a **Ask-Me-Anything** session with the organizers of **revo.js** **conference**. This is a rare opportunity you don't want to miss! See you all soon!",
